Bonjour 
Je peux vous accompagner sur les prestations suivantes:
➢	L'entretien de la maison et les travaux ménagers de votre résidence principale ou secondaire ;
➢	L'assistance administrative à domicile ;
➢	Un soutien scolaire individuel à domicile pour vos enfants de plus de 3 ans ;
➢	L'accompagnement des enfants de plus de 3 ans dans leurs déplacements en dehors de leur domicile (promenades, transport, actes de la vie courante, activités physiques… ) ;
➢	Maintenance, entretien et vigilance temporaires, à domicile, de la résidence principale et secondaire (ouverture, fermeture des volets, arrosage, entretien des plantes, relève du courrier, travaux ménagers…) ;
➢	Les petits travaux de jardinage : tonte de gazon, taille de haie, débroussaillage, l'enlèvement des végétaux, l'entretien de la piscine (plafond annuel de 5000 euros) ;
➢	Les travaux de petit bricolage (plafond annuel de 500 euros) ;
➢	La préparation de repas à domicile, y compris le temps passé aux courses, la livraison de courses à domicile ;
➢	La collecte et la livraison à domicile de linge repassé ;
➢	Les soins (nourriture, litière, accompagnement chez le vétérinaire) et promenades d'animaux de compagnie, pour les personnes dépendantes (pathologies chroniques invalidantes ou momentanées) ;
➢	La prestation de conduite du véhicule personnel des personnes temporairement dépendantes non fragiles pour un accompagnement du domicile au travail, sur le lieu de vacances.
